Система (System) - это место, где выполняется логика игры. На практике система состоит из структуры, реализующей функцию, выполняемую на каждой итерации игрового цикла, и принимающей в качестве аргумента данные об игре. Системы можно рассматривать как маленькую единицу логики. Все системы запускаются движком вместе (даже параллельно, когда это возможно) и выполняют специализированную операцию с одной или группой сущностей. Структура Структура системы - это структура, реализующая типаж amethyst::ecs::System. Вот очень простой пример реализации: # extern crate amethyst;
# use amethyst::ecs::System;
struct MyFirstSystem; impl<'a> System<'a> for MyFirstSystem { type SystemData = (); fn run(&mut self, data: Self::SystemData) { println!("Hello!"); }
} Эта система будет на каждой итерации игрового цикла выводить «Hello!» в консоли. Это довольно скучная система, поскольку она вообще не взаимодействует с игрой. Давайте немного оживим это. Доступ к контексту игры В определении системы этот типаж требует от вас определения типа SystemData. Этот тип определяет, какие данные будут предоставляться системой при каждом вызове метода run. SystemData предназначен только для переноса информации, доступной для нескольких систем. Данные, локальные для системы, обычно хранятся в самой структуре системы. Движок Amethyst предоставляет полезные системные типы данных для доступа к контексту игры. Вот некоторые из наиболее важных: Read<'a, Resource> (или Write<'a, Resource> соответственно) позволяет вам получить неизменяемую (или соответственно изменяемую) ссылку на ресурс указанного вами типа. Это гарантированно не завершится сбоем, так как если ресурс недоступен, он даст вам Default::default() вашего ресурса. ReadExpect<'a, Resource> (или WriteExpect<'a, Resource> соответственно) является отказоустойчивой альтернативой предыдущему типу, поэтому вы можете использовать ресурсы, которые не реализуют типаж Default. ReadStorage<'a, Component> (или WriteStorage<'a, Component> соответственно) позволяет получить неизменяемую (или соответственно изменяемую) ссылку на всё хранилище определенного типа Component. Entities<'a> позволяет вам создавать или уничтожать сущности в контексте системы. Затем вы можете использовать один или несколько из них с помощью кортежа. # extern crate amethyst;
# use amethyst::ecs::{System, Read};
# use amethyst::core::timing::Time;
struct MyFirstSystem; impl<'a> System<'a> for MyFirstSystem { type SystemData = Read<'a, Time>; fn run(&mut self, data: Self::SystemData) { println!("{}", data.delta_seconds()); }
} Здесь мы получаем ресурс amethyst::core::timer::Time для печати в консоль времени, прошедшего между двумя кадрами. Хорошо! Но это все еще немного скучно.

