# use amethyst::ecs::{Entity, System, WriteStorage};
# use amethyst::core::Transform;
struct WalkPlayerUp { player: Entity,
} impl<'a> System<'a> for WalkPlayerUp { type SystemData = WriteStorage<'a, Transform>; fn run(&mut self, mut transforms: Self::SystemData) { transforms.get_mut(self.player).unwrap().prepend_translation_y(0.1); }
} Эта система заставляет игрока подниматься на 0,1 единицы за каждую итерацию игрового цикла! Чтобы определить, что это за игрок, мы заранее сохранили его в структуре системы. Затем мы получаем его Transform из хранилища Transform и перемещаем его вдоль оси Y на 0,1. Transform - очень распространенная структура в разработке игр. Она представляет положение, вращение и масштаб объекта в игровом мире. Вы будете использовать их очень часто, так как они - то, что вам нужно изменить, когда вы хотите что-то изменить в своей игре. Однако такой подход довольно редок, потому что большую часть времени вы не знаете, какой сущностью вы хотите манипулировать, и чаще вы будете применить свои изменения к нескольким сущностям.

