В большинстве случаев вы захотите выполнить логику для всех сущностей с определенным компонентом или даже для всех сущностей с набором компонентов. Это возможно с помощью метода join. Возможно, вы знакомы с операциями объединения, если вы когда-либо работали с базами данных. Метод join принимает несколько хранилищ и выполняет итерацию по всем сущностям, которые имеют компонент в каждом из этих хранилищ. Это работает как "И" ворота. Он вернет итератор, содержащий кортеж всех запрошенных компонентов, если они все на одной и той же сущности. Если вы используете 'join' c компонентами A, B и C, будут рассматриваться только те объекты, которые имеют ВСЕ эти компоненты. Само собой разумеется, что вы можете использовать его только с одним хранилищем для перебора всех объектов с определенным компонентом. Помните, что метод join доступен только при импорте amethyst::ecs::Join. # extern crate amethyst;
# use amethyst::ecs::{System, ReadStorage, WriteStorage};
# use amethyst::core::Transform;
# struct FallingObject;
# impl amethyst::ecs::Component for FallingObject {
# type Storage = amethyst::ecs::DenseVecStorage<FallingObject>;
# }
use amethyst::ecs::Join; struct MakeObjectsFall; impl<'a> System<'a> for MakeObjectsFall { type SystemData = ( WriteStorage<'a, Transform>, ReadStorage<'a, FallingObject>, ); fn run(&mut self, (mut transforms, falling): Self::SystemData) { for (mut transform, _) in (&mut transforms, &falling).join() { if transform.translation().y > 0.0 { transform.prepend_translation_y(-0.1); } } }
} Эта система найдёт все сущности которым принадлежат оба компонента. Компонент Transform с положительной координатой y и компонент тег FallingObject. И уменьшит их координату y на 0,1 единицу за итерацию игрового цикла. Обратите внимание, что поскольку FallingObject присутствует здесь только в качестве тега для ограничения операции объединения (join), мы немедленно отбрасываем его, используя синтаксис \_. Здорово! Теперь это похоже на то, что мы действительно будем делать в наших играх!

