EventChannels гарантируют отправку событий каждому читателю. Чтобы подписаться на события, зарегистрируйте читателя в EventChannel, чтобы получить ReaderId: # extern crate amethyst;
# #[derive(Debug)]
# pub enum MyEvent {
# A,
# B,
# }
# fn main() {
# let mut channel = amethyst::shrev::EventChannel::<MyEvent>::new();
let mut reader_id = channel.register_reader();
# } При чтении событий передайте ReaderId в: # extern crate amethyst;
# #[derive(Debug)]
# pub enum MyEvent {
# A,
# B,
# }
# fn main() {
# let mut channel = amethyst::shrev::EventChannel::<MyEvent>::new();
# let mut reader_id = channel.register_reader();
for event in channel.read(&mut reader_id) { // Тип события выводится из универсального типа, // который мы назначили для `EventChannel <MyEvent>` ранее при его создании. println!("Received event value of: {:?}", event);
}
# } Обратите внимание, что вам нужно иметь доступ только для чтения канала при чтении событий. Это ReaderId, который должен быть изменяемым, чтобы отслеживать, где было ваше последнее чтение. ВАЖНО: Канал событий автоматически увеличивается по мере добавления к нему событий и уменьшается в размере только после того, как все читатели прочитают старые события. Это означает, что если вы создаете ReaderId, но не читаете его в каждом кадре, канал событий начнет потреблять все больше и больше памяти. Шаблоны При использовании канала событий мы обычно снова и снова используем один и тот же шаблон, чтобы максимизировать параллелизм. Последовательность такая: Создаём канал событий и добавляем его в мир во время создания State: # extern crate amethyst;
# use amethyst::{ecs::{World, WorldExt}, shrev::EventChannel};
# #[derive(Debug)]
# pub enum MyEvent {
# A,
# B,
# }
# fn main() {
# let mut world = World::new();
world.insert(EventChannel::<MyEvent>::new());
# } Примечание. Вы также можете установить производную (derive) от Default, таким образом вам не нужно вручную создавать свой ресурс и добавлять его. Ресурсы, реализующие Default, автоматически добавляются в Resources, когда System использует их (Read или Write в SystemData). В системе, создающей события , получите изменяемую ссылку на ваш ресурс: # extern crate amethyst;
